<script setup>
import {defineModel, defineEmits} from "vue"
import axios from "axios";

const songlistlast = defineModel('songlistlast');
const emits = defineEmits(['handlePlayNow', 'handlePlayAfter', 'addToSongList']);
const username = defineModel('username');
const token = defineModel('token')

function handlePlayNow(id) {
  emits('handlePlayNow', id)
}

function handlePlayAfter(id) {
  emits('handlePlayAfter', id)
}

const addlike = (index) => {
  const formData = new FormData();
  formData.append('username', username.value);
  formData.append('song_id', songlistlast.value[index].id);
  const instance = axios.create({
    baseURL: 'http://182.92.100.66:5000',
    timeout: 5000, // 设置请求超时时间
    headers: {
      'Authorization': `Bearer ${token.value}`,
    }
  });
  axios.defaults.withCredentials = true;
  instance.post('/like/songs/add', formData)
      .then(response => {
        console.log(response.data);
        songlistlast.value[index].user_like = true;
      })
      .catch(error => {
        console.log(error.response.data);
      })
}

const deletelike = (index) => {
  const formData = new FormData();
  formData.append('username', username.value);
  formData.append('song_id', songlistlast.value[index].id);
  const instance = axios.create({
    baseURL: 'http://182.92.100.66:5000',
    timeout: 5000, // 设置请求超时时间
    headers: {
      'Authorization': `Bearer ${token.value}`,
    }
  });
  axios.defaults.withCredentials = true;
  instance.post('/like/songs/delete', formData)
      .then(response => {
        console.log(response.data);
        songlistlast.value[index].user_like = false;
      })
      .catch(error => {
        console.log(error.response.data);
      })
}

const addToSongList = (id) => {
  emits('addToSongList', id);
}

</script>

